import { Link } from "react-router-dom";

const DogsCards = (props) => {
    const {id, name, temperament,weight, img} = props
    return(
        <tbody>
        <Link to={`/dogs/${id}`}>
        <tr key={id}>
            
                <td>{name}</td>
                <td>{temperament}</td>
                <td>{weight}</td>
                <td>
                    {/* <img>
                        src = {img}
                        alt = {name}
                        style = {{height: 75}}
                    </img> */}
                </td>
            
        </tr>
        </Link>
        </tbody>
    )
}

export default DogsCards
